import styled from "styled-components";

export const SignInContainer = styled.div`
  width: 380px;
  display: flex;
  flex-direction: column;
  buttons {
    display: flex;
    justify-content: space-between;
  }
`;

export const SignInTitle = styled.h2`
  margin: 10px 0;
`;
